import {React, useEffect, useState} from 'react';
import {Line, Doughnut, Bar} from "react-chartjs-2"

function Graph() {
    const [data, setData] = useState({});
    const [lData, setLdata] = useState({
        labels: ['boston','here','there','were','new'],
        datasets:[
            {
                label:'population',
                data:[500,200,150,133,700],
                backgroundColor:[
                    'rgba(255, 99, 132, 0.2)',
                    'rgba(54, 162, 235, 0.2)',
                    'rgba(255, 206, 86, 0.2)',
                    'rgba(75, 192, 192, 0.2)',
                    'rgba(153, 102, 255, 0.2)'

                ]
            }
        ]
    });
    useEffect(() => {
        fetch("https://disease.sh/v3/covid-19/historical/all?lastdays=10")
        .then(res => res.json())
        .then(data => {

            console.log(Object.key(data.cases));

        })
    }, [])
    return (
        <div>

            <Bar data={lData} />

        </div>
    )
}

export default Graph;
